import React, { useEffect } from 'react';
import './LandingPage.css';
import CustomNavbar from '../components/Navbar';

const LandingPage = () => {
  useEffect(() => {
    // This function will be called when the API is ready
    window.onYouTubeIframeAPIReady = function() {
      new window.YT.Player('player', {
        videoId: 'jfKfPfyJRdk', // YouTube video ID
        events: {
          onReady: (event) => event.target.playVideo()
        }
      });
    };
  }, []);

  return (
    <div className="landing-page">
      <CustomNavbar />
      <div className="background"></div>
      <div className="logo-container">
        <img src="/images/eventme-logo.jpg" alt="EventMe Logo" className="landing-logo" />
        <h1>Welcome to EventMe</h1>
      </div>
      <div id="player" className="audio-iframe"></div>
    </div>
  );
};

export default LandingPage;
